import React from 'react'

class AsideLogin extends React.Component{
    render(){
        return(
            <div className='asideLogin'>
            <h1>Login</h1>
            <form>
                <input type='text' name='username'  />
                <input type='text' name='password'  />
            </form>
            </div>
        )
    }
}

export default AsideLogin
